import React from 'react'; 
import { Link } from "react-router-dom";
import { FaSpa } from "react-icons/fa";
import "./styles/Navbar.css";

const Navbar = () => {
    return (

            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div classNameName="navbar-brand"><Link to="/"><FaSpa color="white" /></Link></div>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav">
                    <li className="nav-item active">
                    <div className="nav-link"><Link to="/">Home<span className="sr-only">(current)</span></Link></div>
                    </li>
                    <li className="nav-item">
                    <div className="nav-link"><Link to="/projects">Projects</Link></div>
                    </li>
                </ul>
            </div>
         </nav>

    );
}

export default Navbar;
